@cticenhour  The examples in the link https://mooseframework.inl.gov/getting_started/examples_and_tutorials/index.html is working for me.. Thank you for the inputs.. now I am trying to use the link https://shannon-lab.github.io/zapdos/getting_started/using_zapdos.html
In this link, i see the following instruction: After Zapdos is installed and tested, you should now be able to run input files using the zapdos-opt executable located at ~/projects/zapdos. Input files demonstrating the capabilities of Zapdos can be found in ~/projects/zapdos/tutorial and ~/projects/zapdos/tests. Any input file (say, one called example_input.i) can be run with the following basic syntax. ~/projects/zapdos/zapdos-opt -i example_input.i
Now, my question is, shouldnt I use "make" first, to  create -opt file? i dont see zapdos-opt within the tutorial or tests folder, where input files are there.

I know the _q_point is the coordinate of the current qp point. But how to take the x coordinate out?
I've tried to make double xx = _q_point[0];
But it report an error: cannot convert 'const libMesh::Point' to 'double' in initialization.

